    try {
      const res = await axios.get('http://localhost:8080/goals')
      return res.data;
    }
    catch (err) {
      console.log(err);
    }
  }

  useEffect(() => {
    fetchData()
      .then(data => {
        setData(data)
      })
      .catch(err => console.log(err))
  }, [])
  console.log(data);
  return (
    <div>
      GOALS
